import React, { Component } from 'react'
import { Grid, Container, Typography } from "@material-ui/core"
import Popup from "./Popup"

export class Member extends Component {
    constructor(member) {
        super(member);
        this.member = member
        this.state = {
          count: 0
        };
      }

      render() {
        return (     
            <button onClick={() => {
                    this.setState({ count: this.state.count + 1 })
                    var myDiv = document.getElementById("GFG");
                 
                    // creating button element
                    var button = document.createElement('BUTTON');
                     
                    // creating text to be
                    //displayed on button
                    var text = document.createTextNode("Button");
                     
                    // appending text to button
                    button.appendChild(text);
                     
                    // appending button to div
                    myDiv.appendChild(button); ;
                    return <div>
                    {<Popup
                      content={<>
                        <b>Design your Popup</b>
                        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
                        <button>Test button</button>
                      </>}
                    />}
                  </div>
                }
            }>
            <Grid item lg={3} md={4}>
                <div className='member'>
                    <a>
                        <img className='memberPhoto' src={`${this.member.photo}`} alt='user' />
                        <div className='memberInfo'>
                            <h3 className='memberName'>{this.member.name}</h3>
                            <small className='memberPosition'>{this.member.position}</small>
                            {/* <p className='memberDesc'>{member.desc}</p> */}
                            <p>You clicked {this.state.count} times</p>
                        </div>
                    </a>
                </div>
            </Grid>
            </button>

        )}
                
}

export default Member
